  useEffect(() => {
    FrontendLog("info", "component", "App component mounted");
    FrontendLog("warn", "api", "Slow response from user API");
    FrontendLog("error", "hook", "useAuth failed to fetch user data");
  }, []);

  return (
    <div>
      <h1>ðŸš€ Frontend Logger Test</h1>
